import 'package:flutter/material.dart';

Color kPrimaryColor = Color(0xff1c61a4);
Color kConfirmedColor = Color(0xff1c61a4);
Color kActiveColor = Color(0xffea8110);
Color kRecoveredColor = Color(0xff29bd7c);
Color kDeathColor = Color(0xff9e1717);

LinearGradient kGradientShimmer = LinearGradient(
  begin: Alignment.centerLeft,
  end: Alignment.centerRight,
  colors: [
    Colors.grey[300],
    Colors.grey[100],
  ],
);

RegExp reg = new RegExp(r'(\d{1,3})(?=(\d{3})+(?!\d))');
Function mathFunc = (Match match) => '${match[1]}.';
